import React from "react";

function SliderNumberx({ activeSlide, total }: any): JSX.Element {
  return (
    <div
      style={{
        position: "absolute",
        zIndex: 3,
        right: 10,
        top: "15px",
        fontFamily: "Arial, Helvetica, sans-serif",
        fontWeight: "bolder",
      }}
    >
      <span
        style={{
          height: "200px",
          width: "20px",
          paddingLeft: "7px",
          paddingRight: "7px",
          backgroundColor: "rgba(255,255,255,0.6)",
          padding: "5px",
          borderRadius: "40%",
          fontSize: "0.92vw",
        }}
      >
        {activeSlide + 1}
        <span style={{ fontSize: "0.8vw" }}>/</span>
        {total}
      </span>
    </div>
  );
}

export const SliderNumber = React.memo(SliderNumberx);
